import React from 'react';
import { MissionsInfoQuery } from './../../generated/graphql'
import {NowCallThis} from './../NowCallThis';
//Yahan say pass karo flight_number NowCallThis ko aur wahan say
//index.tsx ko id bana k


interface Props {
    data: MissionsInfoQuery
}

const MissionList: React.FC<Props> = ({ data }) => {

    return (
        <div>
            <ul className="MissionName">
                {data.launches?.map((launchObj,ind)=>{
                    return (
                        <li key={ind} className="MissionNameContainer" >
                            {/*launchObj?.mission_name}
                            {launchObj?.__typename*/}
                            {launchObj?.flight_number}
                        </li>
                    )
                })}
            </ul>
        </div>
    )
}

export default MissionList;
